قال تعالى…
{إِنَّمَا يُوَفَّى الصَّابِرُونَ أَجْرَهُمْ بِغَيْرِ حِسَابٍ} 

{وَجَزَاهُمْ بِمَا صَبَرُوا جَنَّةً وَحَرِيراً} 

{وَلنَجْزِيَنَّ الَّذِينَ صَبَرُوا أَجْرَهُمْ بِأَحْسَنِ مَا كَانُوا يَعْمَلُونَ}

* تلك المنزلة ( منزلة الصابرين ) تستحق منك هذا التعب وهذا الجُهد .
